import React from 'react';
import classes from './CustomButton.module.scss';


const CustomButton = ({ children, ...otherProps }) => {
  return (
    <button type="button" className={classes.CustomButton} {...otherProps} >
      {children}
    </button>
  );
};

export default CustomButton;
